import React from 'react';
import './About.css'; // Make sure to import your CSS file

const About = () => {
    return (
        <div className="About-container">
            <div className="About-website">
                <h1 className="About-website-header">Transcripter App</h1>
                <p>
                    Transcripter is a web app created using React.js, utilizing{' '}
                    <a href="https://platform.openai.com/docs/guides/speech-to-text">OPENAI's Whisper model</a>, PHP for the backend server, and MariaDB for the database.
                </p>
            </div>
            <div className="About-developers">
                <div className="About-developer">
                    <h1>Zeyad Taleb Alamoudi</h1>
                    <a className="linkedin" href="https://www.linkedin.com/messaging/thread/2-ZTU1YjAxZmMtMzRmNC00YWJiLWIyYmItYTAyZWRjMDBhMDFlXzAxMg==/">LinkedIn</a>
                </div>
                <div className="About-developer">
                    <h1>Anas Rajab Alzahrani</h1>
                    <a className="linkedin" href="https://www.linkedin.com/messaging/thread/2-ZTU1YjAxZmMtMzRmNC00YWJiLWIyYmItYTAyZWRjMDBhMDFlXzAxMg==/">LinkedIn</a>
                </div>
                <div className="About-developer">
                    <h1>Faisal Ahmed Alzahrani</h1>
                    <a className="linkedin" href="https://www.linkedin.com/messaging/thread/2-ZTU1YjAxZmMtMzRmNC00YWJiLWIyYmItYTAyZWRjMDBhMDFlXzAxMg==/">LinkedIn</a>
                </div>
            </div>
        </div>
    );
};

export default About;
